== GA Review ==
{{Talk:Roman–Parthian War of 58–63/GA1}}

== Excellent map ==
The first map you have in the article is absolutely stunning - easily on a par with Featured maps I've seen. Cplakidas should be congratulated. It's unfortunate that the map below it is not of the same quality. Some notation (arrows and battle symbols) showing  major troop movements & battles would perfect this excellent foundation. It would not be hard for you to add the arrows and symbols  if you learn a ''little'' bit about using Inkscape. Good luck with taking the article further. [[User:Dhatfield|Dhatfield]] ([[User talk:Dhatfield|talk]]) 21:49, 9 April 2009 (UTC)
